import React from 'react';


class App extends React.Component{

    constructor(props){
        super(props)
        this.state = {
            error: null,
            isLoaded: false,
            items: []
        }
    }

    componentDidMount(){
        fetch('https://dummyjson.com/users')
        .then(res => res.json())
        .then(
            (result) => {
                this.setState(
                    isLoaded = true,
                    items = result.users
                );
            },
            (error => {
                this.setState({
                    isLoaded: true,
                    error
                })
            })
        )
    }

    render(){
        const {error, isLoaded, items} = this.state
        if(error){
            return <p>Error</p>
        }
        else if(!isLoaded){
            return <p>Loading...</p>
        }
        else{
            return(
                <div>
                    <ul>
                        {itemss.map(item => (
                            <li>{item.name}</li>
                        ))}
                    </ul>
                </div>
            )
        }
    }
}

export default App
